function plot_ap_vs_speed_graph (celldata, container, title) {
    var temp_func = function() {
        Highcharts.chart(container, {
            chart: {
                type: 'scatter',
                zoomType: 'xy',
                //backgroundColor: 'transparent',
                events: {
                  load: function() {
                    $(window).resize();
                  }
                }
            },
            title: {
                text: 'Aspect Ratio (longest/second longest) vs Speed ',
            },
            /*subtitle: {
                text: title
            },*/
            xAxis: {
                title: {
                    enabled: true,
                    text: 'Speed (microns/minute)'
                },
                startOnTick: true,
                endOnTick: true,
                showLastLabel: true
            },
            yAxis: {
                title: {
                    text: 'Aspect Ratio'
                }
            },
            /*legend: {
                layout: 'vertical',
                align: 'right',
                verticalAlign: 'top',
                x: 100,
                y: 70,
                floating: true,
                backgroundColor: (Highcharts.theme && Highcharts.theme.legendBackgroundColor) || '#FFFFFF',
                borderWidth: 1
            },*/
            plotOptions: {
                scatter: {
                    marker: {
                        radius: 3,
                        states: {
                            hover: {
                                enabled: true,
                                lineColor: 'rgb(100,100,100)'
                            }
                        }
                    },
                    states: {
                        hover: {
                            marker: {
                                enabled: false
                            }
                        }
                    },
                    tooltip: {
                        headerFormat: '<b>{series.name}</b><br>',
                        pointFormat: '{point.x} microns/min, {point.y}'
                    }
                }
            },
            series: [{
                name: title,
                /*color: 'rgba(223, 83, 83, .8)',*/
                color: '#3CC994',
                data: celldata

            }]
        });
    }
    
    window.setTimeout(temp_func, 50);
}




